import React from "react";
import { Card } from "antd";
import { Table, Switch, Radio, Form, Space } from "antd";
import { DownOutlined } from "@ant-design/icons";
const scroll = {};

scroll.y = 240;

scroll.x = "100vw";

const columns = [
	{
		title: "Name",
		dataIndex: "name",
	},
	{
		title: "Age",
		dataIndex: "age",
		sorter: (a, b) => a.age - b.age,
	},
	{
		title: "Address",
		dataIndex: "address",
		filters: [
			{
				text: "London",
				value: "London",
			},
			{
				text: "New York",
				value: "New York",
			},
		],
		onFilter: (value, record) => record.address.indexOf(value) === 0,
	},
	{
		title: "Action",
		key: "action",
		sorter: true,
		render: () => (
			<Space size="middle">
				<a>Delete</a>
				<a className="ant-dropdown-link">
					More actions <DownOutlined />
				</a>
			</Space>
		),
	},
];

const data = [];
for (let i = 1; i <= 10; i++) {
	data.push({
		key: i,
		name: "John Brown",
		age: `${i}2`,
		address: `New York No. ${i} Lake Park`,
		description: `My name is John Brown, I am ${i}2 years old, living in New York No. ${i} Lake Park.`,
	});
}

const OrderBook = () => {
	return (
		<div className="">
			<Card className="orderBook">
				<Table
					pagination={{ position: "bottom" }}
					columns={2}
					dataSource={data}
					scroll={scroll}
				/>
				<Table
					pagination={{ position: "bottom" }}
					columns={2}
					dataSource={data}
					scroll={scroll}
				/>
			</Card>
		</div>
	);
};

export default OrderBook;

